import React from "react";
import "./Footer.css";

const Footer = () => {
  return (
    <>
      <footer>
        <div className="bg-dark"></div>
        <h4 className="  text-white text-center">Showing Pandemic Data</h4>
        <div className="side">Power Rangers SPD duniya ke Rakhwale.</div>
      </footer>
    </>
  );
};
export default Footer;
